package app.diimport app.createProfile.CreateProfileScreenModelimport app.login.LoginScreenModelimport app.main.profile.ProfileScreenModelimport app.register.RegisterScreenModelimport org.koin.dsl.modulefun appModule() = listOf(	loginModule,	registerModule,	profileModule,	createProfileModule)private val loginModule = module {	factory {		LoginScreenModel(get())	}}private val registerModule = module {	factory {		RegisterScreenModel(get())	}}private val profileModule = module {	factory {		ProfileScreenModel(get(), get())	}}private val createProfileModule = module {	factory {		CreateProfileScreenModel(get(), get())	}}